import Models from "../database/models";

const { exams, questions } = Models;

class examsController {
  static async addExam(req, res) {
    try {
      if (req.exam) {
        return res.status(400).json({
          status: 400,
          message: "Exam with this name already exist, please use onather!",
        });
      }
      const { name, startDate, subject } = req.body;
      await exams.create({
        name,
        startDate,
        subject,
      });
      return res.status(200).json({
        status: 200,
        message: "Exam have been added",
      });
    } catch (error) {
      return res.status(500).json({
        status: 500,
        message: error.message,
      });
    }
  }
  static async getAllExam(req, res) {
    try {
      const examsData = await exams.findAll();
      res.status(200).json({
        status: 200,
        message: "All Exam",
        data: examsData,
      });
    } catch (error) {
      res.status(500).json({ status: 500, message: error.message });
    }
  }

  static async updateExam(req, res) {
    try {
      const { name, subject, startDate } = req.body;
      const { id } = req.params;
      const found = await exams.findOne({
        where: { id },
      });
      if (found) {
        const updatedExam =await exams.update(
          {
            name,
            subject,
            startDate,
          },
          { where: { id }, 
          returning: true }
        );

        return res.status(200).json({
          status: 200,
          message: "Exam updated",

          data: updatedExam,
        });
      }
      res.status(404).json({
        status: 404,
        message: "Exam not found",
      });
    } catch (error) {
      console.log(error);
      res.status(500).json({ status: 500, message: error.message });
    }
  }

  static async deleteExam(req, res) {
    try {
      const modelId = req.params.id;
      const found = await exams.findOne({
        where: { id: modelId },
      });
      if (found) {
        await exams.destroy({
          where: { id: modelId },
        });
        return res.status(200).json({
          status: 200,
          message: "Exam was deleted successfull!",
        });
      }
      res.status(404).json({
        status: 404,
        message: "Exam not found",
      });
    } catch (error) {
      res.status(500).json({ status: 500, message: error.message });
    }
  }
  static async findOneExam(req, res) {
    try {
      const modelId = req.params.id;
      const singleExam = await exams.findOne({
        where: { id: modelId },
        include:[
          {
            model: questions
          }
        ]
      });
      if (!singleExam) {
        res.status(404).json({
          status: 404,
          message: "Exam not found ",
        });
      }
      res.status(200).json({
        status: 200,
        message: "Exam Information",
        data: singleExam,
      });
    } catch (error) {
      console.log(error);
      res.status(500).json({ status: 500, message: error.message });
    }
  }
}

export default examsController;

