import Models from '../database/models';
const users =Models;

class IsVerifiedAccount{
    static async isVerified(req,res, next){

        try {
            const user=await users.findOne({
                where: {isActive:true},
            });
            if(user.isVerified){
                return next();
            }
            req.flash('error', 'Your account has not been verified, please check your email to verify!')
            return res.redirect('/');
        } catch (error) {
          console.log(error);
          req.flash('error', 'Something went wrant, Please contact us for assistance!') 
          return res.redirect('/'); 
        }
    };
}
 

export default IsVerifiedAccount;

